import React from "react";
import './style.css';

export default function ItemLista(props) {
    return (
        <div className="box">
            <div className="nome">
                {props.signo}
            </div>
            <img className="imagem" src={props.imagem} alt={props.signo} />
            <div className="dataCriacao">
                {props.descricao}
            </div>
        </div>
    );
}
